import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 21-406 Surplus in hands of treasurer.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/21-406.md","filePath":"vacode/21-406.md"}'),n={name:"vacode/21-406.md"},o=t('<h1 id="§-21-406-surplus-in-hands-of-treasurer" tabindex="-1">§ 21-406 Surplus in hands of treasurer. <a class="header-anchor" href="#§-21-406-surplus-in-hands-of-treasurer" aria-label="Permalink to &quot;§ 21-406 Surplus in hands of treasurer.&quot;">​</a></h1><p>If the funds in the hands of any county treasurer at any time arising under §§ <a href="http://law.lis.virginia.gov/vacode/21-403/" target="_blank" rel="noreferrer">21-403</a>, <a href="http://law.lis.virginia.gov/vacode/21-404/" target="_blank" rel="noreferrer">21-404</a>, <a href="http://law.lis.virginia.gov/vacode/21-405/" target="_blank" rel="noreferrer">21-405</a>, <a href="http://law.lis.virginia.gov/vacode/21-408/" target="_blank" rel="noreferrer">21-408</a> or <a href="http://law.lis.virginia.gov/vacode/21-409/" target="_blank" rel="noreferrer">21-409</a>, or in any other manner, shall be greater than is necessary to pay the annual installments of principal and interest, or the annual cost of maintenance of the drainage works, or both, such surplus shall be held by the county treasurer for future disbursements for other purposes as herein provided or subject to the order of the county board of drainage commissioners of the county in which the petition was filed.</p><p>Code 1919, § 1776; 1926, p. 625.</p>',3),s=[o];function i(l,h,d,c,u,f){return r(),a("div",null,s)}const v=e(n,[["render",i]]);export{_ as __pageData,v as default};
